    "# ** How do annual members and casual riders use Cyclistic bikes differently? **\n",
    "\n",
    "**Notes: The director of marketing believes the company’s future success depends on maximizing the number of annual memberships, to understand how casual riders and annual members use Cyclistic bikes differently, From these insights, I am designing a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve my recommendations, so they must be backed up with this compelling data insights and this data visualizations.**\n",
    "\n",
    "The goal is to identify behavioral patterns that distinguish **casual riders** from **annual members**, This a **data-driven marketing strategy**."
   ]
