   "source": [
    "#calculating the trip duration from the start time and end time\n",
    "\n",
    "df1$started_at <- as.POSIXct(df1$started_at, format = \"%Y-%m-%d %H:%M:%S\")\n",
    "df1$ended_at   <- as.POSIXct(df1$ended_at, format = \"%Y-%m-%d %H:%M:%S\")\n",
    "\n",
    "df1$trip_duration <- as.numeric(difftime(df1$ended_at, df1$started_at, units = \"mins\"))\n",
    "\n",
    "df1$trip_duration"
   ]
