   "source": [
    "# Members often ride during weekdays for commuting; casuals ride more on weekends!!.\n",
    "\n",
    "ride_count1 <- df1 %>%\n",
    "  mutate(day_of_week = weekdays(as.Date(started_at)))%>%\n",
    "  filter(!is.na(member_casual), !is.na(day_of_week)) %>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarize(total_rides = n(), .groups = \"drop\") %>%\n",
    "  arrange(member_casual, match(day_of_week, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")))\n",
    "ride_count1"
   ]
