   "source": [
    "ride_count1 <- df1%>%\n",
    "mutate(day_of_week = weekdays(as.Date(started_at)))%>%\n",
    "filter(!is.na(member_casual), !is.na(day_of_week))%>%\n",
    "group_by(member_casual, day_of_week)%>%\n",
    "summarize(total_rides = n(), .groups = \"drop\")\n",
    "\n",
    "ggplot(data = ride_count1) + geom_col(mapping =aes(x = day_of_week, y = total_rides, color=member_casual)) +\n",
    "labs(title = \"Member Ride VD Casual Ride\", \n",
    "     subtitle = \"Member often ride during weekdays for cummuting; Casual ride more on weekends\",\n",
    "    caption = \"Project analyzed by I Austine Obasuyi (www.datacalculations.com, size \") +\n",
    "theme_grey() +\n",
    "theme(axis.text.x = element_text(angle = 15, hjust = 0))"
   ]
