   "source": [
    "# Ride Count\n",
    "ride_count <- df%>%\n",
    "  mutate(day_of_week = weekdays(as.Date(start_time))) %>%\n",
    "  filter(!is.na(usertype), !is.na(day_of_week)) %>%\n",
    "  group_by(usertype, day_of_week) %>%\n",
    "  summarize(total_rides = n(), .groups = \"drop\") %>%\n",
    "  arrange(usertype, match(day_of_week, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")))\n",
    "ride_count"
   ]
