   "source": [
    "# Subscribers often ride during weekdays for commuting; Customers ride more on weekends..\n",
    "ride_count <- df%>%\n",
    "  mutate(day_of_week = weekdays(as.Date(start_time))) %>%\n",
    "  filter(!is.na(usertype), !is.na(day_of_week)) %>%\n",
    "  group_by(usertype, day_of_week) %>%\n",
    "  summarize(total_rides = n(), .groups = \"drop\")\n",
    "ggplot(data = ride_count) +\n",
    "  geom_path(aes(x = day_of_week, y = total_rides, color = usertype, group = usertype)) +\n",
    "  labs(title = \"Subscriber Ride vs Customer Ride\",\n",
    "    subtitle = \"Subscribers often ride during weekdays for commuting; Customers ride more on weekends\",\n",
    "    caption = \"Plot analyzed by I Austine Obasuyi\") +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
   ]
  },
