    "summary_df1 <- df1 %>%\n",
    "  mutate(trip_duration = as.numeric(gsub(\"[^0-9.]\", \"\", trip_duration)),\n",
    "    day_of_week = weekdays(as.Date(started_at))) %>%\n",
    "  filter(!is.na(member_casual), !is.na(day_of_week), !is.na(trip_duration)) %>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarize(total_rides = n(),\n",
    "    avg_trip_duration = mean(trip_duration, na.rm = TRUE),\n",
    "    median_trip_duration = median(trip_duration, na.rm = TRUE),\n",
    "    .groups = \"drop\") %>%\n",
    "  arrange(member_casual, match(day_of_week, c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")))\n",
    "\n",
    "summary_df1"
   ]
