   "source": [
    "library(ggplot2)\n",
    "\n",
    "# Ride frequency by day\n",
    "merged_df1 %>%\n",
    "  mutate( day_of_week = weekdays(as.Date(started_at))) %>%\n",
    "  filter(!is.na(member_casual), !is.na(day_of_week))%>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarize(total_rides = n(), .groups = \"drop\") %>%\n",
    "\n",
    "  ggplot(aes(x = day_of_week, y = total_rides, fill = member_casual)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  labs(title = \"Rides by Day of Week\", x = \"Day\", y = \"Number of Rides\", \n",
    "     subtitle = \"Tuesday is the busiest day follow by Wednesday and Monday, Thursday\",\n",
    "    caption = \"plot analyzed by I Austine Obasuyi (www.datacalculations.com, size \") +\n",
    "  theme_minimal()\n",
    "\n",
    "# Ride frequency by day\n",
    "merged_df1 %>%\n",
    "  mutate(day_of_week = weekdays(as.Date(started_at))) %>%\n",
    "  filter(!is.na(member_casual), !is.na(day_of_week))%>%\n",
    "  group_by(member_casual, day_of_week) %>%\n",
    "  summarize(total_rides = n(), .groups = \"drop\") %>%\n",
    "\n",
    "  ggplot(aes(x = day_of_week, y = total_rides, fill = day_of_week)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  labs(title = \"Ride frequentcy by day\", \n",
    "     subtitle = \"Tuesday is the busiest day follow by Wednesday and Monday, Thursday\",\n",
    "    caption = \"plot analyzed by I Austine Obasuyi (www.datacalculations.com, size \") +\n",
    "theme_grey() +\n",
    "theme(axis.text.x = element_text(angle = 15, hjust = 0))"
   ]
