   "source": [
    "# Casual riders often ride longer because they are likely tourists or occasional users, while members commute and take shorter trips.\n",
    "\n",
    "# Calculate trip duration and summarize by member_casual\n",
    "result_df <- merged_df %>%\n",
    "  mutate(\n",
    "    end_time = as.POSIXct(end_time, format = \"%Y-%m-%d %H:%M:%S\"),\n",
    "    start_time = as.POSIXct(start_time, format = \"%Y-%m-%d %H:%M:%S\"),\n",
    "    tripduration = as.numeric(difftime(end_time, start_time, units = \"mins\"))\n",
    "  ) %>%\n",
    "  group_by(usertype) %>%\n",
    "  summarize(\n",
    "    avg_trip_duration = mean(tripduration, na.rm = TRUE),\n",
    "    median_trip_duration = median(tripduration, na.rm = TRUE)\n",
    "  )\n",
    "result_df"
   ]
