    "### Average Trip Duration by Rider Type\n",
    "\n",
    "avg_duration <- merged_df1%>%\n",
    "  group_by(member_casual) %>%\n",
    "  summarise(avg_trip_duration = mean(trip_duration, na.rm = TRUE))\n",
    "\n",
    "ggplot(avg_duration, aes(x = member_casual, y = avg_trip_duration, fill = member_casual)) +\n",
    "  geom_col(width = 0.6) +\n",
    "  labs( title = \"Average Trip Duration (Minutes)\", x = \"Rider Type\", y = \"Avg Trip Duration\", fill = \"Rider Type\", caption = \"plot by I Austin Obasuyi 'www.datacalculations.com'\") +\n",
    "  scale_fill_manual(values = c(\"casual\" = \"#FFA07A\", \"member\" = \"#4682B4\")) +\n",
    "  theme_minimal()"
   ]
