    "### Monthly Ride Trends by Rider Type\n",
    "\n",
    "monthly_rides <- df1 %>%\n",
    "  mutate(month = month(started_at, label = TRUE)) %>%\n",
    "  group_by(month, member_casual) %>%\n",
    "  summarise(rides = n(), .groups = \"drop\")\n",
    "\n",
    "ggplot(monthly_rides, aes(x = month, y = rides, group = member_casual, color = member_casual)) +\n",
    "  geom_line(linewidth = 1.2) +  # <-- updated from size to linewidth\n",
    "  geom_point(size = 2) +\n",
    "  labs(\n",
    "    title = \"Monthly Ride Trends by Rider Type\",\n",
    "    x = \"Month\", y = \"Total Rides\", color = \"Rider Type\",\n",
    "    caption = \"plot by Austine Obasuyi 'www.datacalculations.com'\"\n",
    "  ) +\n",
    "  scale_color_manual(values = c(\"casual\" = \"#FF4500\", \"member\" = \"#4169E1\")) +\n",
    "  theme_minimal()"
   ]
